function Winner(props) {
    return (
        <>
            <td className={"recent-winner"}>{props.winner.player}</td>
            <td className={"recent-winner"}>{props.winner.fee}eth</td>
            <td className={"recent-winner"}></td>
            <td className={"recent-winner"}>{props.winner.won}eth</td>
            <td className={"recent-winner"}>{props.winner.date}</td>
        </>
    );
}

export default Winner;
